USE [2am]
GO

IF EXISTS (SELECT 1
            FROM sys.objects
            WHERE object_id = OBJECT_ID(N'solr.SolrFullImportWebRequest')
            AND type IN ( N'P', N'PC' ))
BEGIN
	DROP PROCEDURE solr.SolrFullImportWebRequest
END
GO

IF EXISTS(	SELECT 1 
			FROM sys.assemblies 
			WHERE name = 'SolrFullImport.CLR')
BEGIN
	DROP ASSEMBLY [SolrFullImport.CLR]
END
GO

/**************** CREATE ASSEMBLY ******************/

CREATE ASSEMBLY [SolrFullImport.CLR]
    AUTHORIZATION [dbo]
    FROM 
	WITH PERMISSION_SET = UNSAFE;


GO
ALTER ASSEMBLY [SolrFullImport.CLR]
    DROP FILE ALL
    ADD FILE FROM  AS N'SolrFullImport.CLR.pdb';


GO

GO
PRINT N'Creating SolrFullImport.CLR...';

GO

/******************* CREATE CLR PROC ************************/

