											@indexName			NVARCHAR (4000), 
											@importType			NVARCHAR (4000)
AS 

/*****************************************************************************************************************************************
		Author		:	VirekR
		CreateDate	:	2015/05/14
		Description	:	This proc will pass through an Index Name (Client,ThirdParty etc) and an import type (full or delta import etc)
						to the CLR proc which will pick up the required URI
